import Canvas from './Canvas';

import logo from '../images/homepage/header8.png';
import info from '../images/homepage/info.png';
import {db} from './Firebase.js'
import {doc ,getDoc, setDoc  } from "firebase/firestore";

const docRef  = doc(db, "prueba","qwe")
const docSnap =  getDoc(docRef);
console.log(docRef);  
console.log(docRef._key.path.segments)

setDoc(doc(db, "pixeles"), { 
      horizontal:2,
      vertical:2,
      taked:true,
      date:"122123123",
      payed:true,
      imagen:"" 

});

function Home() {
  return( 
    <div className="container">
      <div className="header-collection">
        <div className="header-logo">
          <a href="/">
            <img src={logo} width="1000" alt="" />
          </a>
        </div>
      </div>

     <div className="nav-collection">
       <div className="nav-item">
        <img src={info} width="300" alt="" />
       </div>
       
      </div>
      <div className="ad">
        <div className="ad-collection">
          <Canvas />
        </div>
      </div>
    </div>
  );
}

export default Home;
